import 'bootstrap/dist/css/bootstrap.min.css';
import { BiHome } from "react-icons/bi";
import { Nav, Navbar } from 'react-bootstrap';
import { BrowserRouter as Routes, Route } from 'react-router-dom';
import PartnerForm from './PartnerForm';
import PartnerHome from "./PartnerHome";
import PartnerProfile from "./PartnerProfile";
function Partner() {

    return (
        <div>
            <Navbar bg="dark" variant="dark">
                <Nav.Link href="/PartnerHome">
                    <div className="image_icon_nav">
                        <BiHome />
                    </div>
                </Nav.Link>
                <Nav className="me-auto">
                    <Nav.Link href="#JobAd">Job Ad</Nav.Link>
                    <Nav.Link href="#searchuser">Search user</Nav.Link>
                    <Nav.Link href="#Statics">Statics</Nav.Link>
                </Nav>
                <Navbar.Collapse className="justify-content-end">
                    <Navbar.Text>
                        Signed in as: <a href="/PartnerProfile">NicholasLow</a>
                    </Navbar.Text>
                </Navbar.Collapse>
            </Navbar>

            <div>
                <PartnerHome />
                
            </div>
        </div>
    );
}

export default Partner;
